  `unicode` varchar(40) DEFAULT NULL COMMENT '用户唯一号',
  `certid` int(11) NOT NULL COMMENT '证书id',
  `reason` int(11) DEFAULT NULL COMMENT '2-过期，3-注销，4-变更，5-挂失',
  `invalidtime` datetime DEFAULT NULL COMMENT '失效时间',
  `appusergroupid` int(11) NOT NULL DEFAULT '0' COMMENT '用户组ID',
  `orgid` int(11) NOT NULL DEFAULT '0' COMMENT '组织ID',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

