-- ----------------------------
-- Table structure for user
-- ----------------------------
DROP TABLE IF EXISTS `user`;
CREATE TABLE `user` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '记录Id;PK',
  `username` varchar(30) DEFAULT NULL COMMENT '用户名;UNIQUE',
  `password` varchar(50) DEFAULT NULL COMMENT '用户登录密码',
  `salt` varchar(50) DEFAULT NULL COMMENT '加盐',
  `email` varchar(40) DEFAULT NULL COMMENT '用户邮箱',
  `mphone` char(40) DEFAULT NULL COMMENT '手机号;UNIQUE',
  `realname` char(20) DEFAULT NULL COMMENT '用户真实姓名',
  `socialsecid` char(100) DEFAULT NULL COMMENT '身份证号;UNIQUE',
  `org` varchar(50) DEFAULT NULL COMMENT '单位名称',
  `regtime` datetime DEFAULT NULL COMMENT '用户注册时间',
  `category` int(11) DEFAULT '1' COMMENT '用户类型;1-应用管理员；2-系统管理员',
  `state` int(11) DEFAULT '1' COMMENT '用户状态;1-启用;2-禁用,默认1',
  `passwordchangetime` datetime DEFAULT NULL COMMENT '口令修改时间',
  `token` varchar(700) DEFAULT NULL COMMENT 'token',
  PRIMARY KEY (`id`),
  UNIQUE KEY `username_unique` (`username`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=4 DEFAULT CHARSET=utf8 COMMENT='用户表';

-- ----------------------------
-- Records of user
-- ----------------------------

-- ----------------------------
-- Table structure for usersignimg
-- ----------------------------
DROP TABLE IF EXISTS `usersignimg`;
CREATE TABLE `usersignimg` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '记录Id;PK',
  `appid` varchar(40) NOT NULL COMMENT '应用id	FK_app(id)，NOT NULL',
  `userid` varchar(40) NOT NULL COMMENT '绑定用户ID,(appid,userid)unique，NOT NULL,可是应用系统的userid或username',
  `uniqueid` varchar(40) DEFAULT NULL COMMENT '用户唯一号,解决不同应用userid对应同一人问题;可是身份证号或工号等(暂弃用)。接入业务系统登录帐号一致，用userid填充；否则用身份证号填充。',
  `signpicname` varchar(60) DEFAULT NULL COMMENT '签名图片文件名,"文件存放于签章服务器上，命名规则为：绑定用户ID+姓名，如20100304张凯.png如果没有上传签名图片，则该字段为空"',
  `signpicver` int(11) DEFAULT NULL COMMENT '签名图片版本号,没有签名图片时该字段为0，每次更新后该字段值增1',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='用户签名图片表';

-- ----------------------------
-- Records of usersignimg
-- ----------------------------

-- ----------------------------
-- Table structure for whitelist
-- ----------------------------
DROP TABLE IF EXISTS `whitelist`;
CREATE TABLE `whitelist` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '记录Id;PK',
  `ip` varchar(40) DEFAULT NULL COMMENT 'ip地址/地址段',
  `memo` varchar(50) DEFAULT NULL COMMENT '备注',
  `valid` int(11) DEFAULT '1' COMMENT '是否有效;1-有效，2-无效；默认1',
  PRIMARY KEY (`id`),
  UNIQUE KEY `ip_unique` (`ip`)
) ENGINE=InnoDB AUTO_INCREMENT=11 DEFAULT CHARSET=utf8 COMMENT='IP白名单表';

